import React, { Component } from 'react';
import Layout from '../Components/Layout'
import voting from '../Ethereum/voting'
import {Card} from 'semantic-ui-react'

class votingInstance extends Component{

    static getInitialProps = async () =>{
        return{
            address : voting.options.address
        }
    }

    render(){
        return(
            <Layout>
                <Card>
                    <Card.Content>
                        <Card.Header>{this.props.address}</Card.Header>
                        <Card.Meta>Election Address</Card.Meta>
                        <Card.Description>This the Address on which the Election Contract jas </Card.Description>
                    </Card.Content>
                </Card>
            </Layout>
        );
    }
}

export default votingInstan
